import React, { useState, Dispatch, SetStateAction, } from 'react';
import {
    DetailedIconArrayObject,
  }
from './iconArrayGeneration';

type clickHandlerArguments = {
    event: React.MouseEvent<HTMLDivElement, MouseEvent>, 
    icon: DetailedIconArrayObject, 
    i: number, 
    detailedIconArray:DetailedIconArrayObject[], 
    setDetailedIconArray:Dispatch<SetStateAction<DetailedIconArrayObject[]>>
  }

type OptionalMiddleName = {
    talentPathDetailedIconArray: DetailedIconArrayObject[],
    setTalentPathDetailedIconArray:Dispatch<SetStateAction<DetailedIconArrayObject[]>>,
    leftClick: clickHandlerArguments,
    rightClick: clickHandlerArguments,
}

function SkillsList({
    talentPathDetailedIconArray, 
    leftClick, 
    rightClick, 
    setTalentPathDetailedIconArray}:OptionalMiddleName)
{
    <div>
        <p> Talent Path 1</p>
        {talentPathDetailedIconArray.map((icon: DetailedIconArrayObject, i: number) => 
            {
                return (
                    <div 
                        key = {i} 
                        className={`${icon?.iconClicked? "active" : "inactive"}`} 
                        onClick={e => leftClick(e, icon, i, talentPathDetailedIconArray, setTalentPathDetailedIconArray)} 
                        onContextMenu={e => rightClick(e, icon, i, talentPathDetailedIconArray, setTalentPathDetailedIconArray)}  
                    >
                        <img 
                            onMouseOver={(e) => {e.currentTarget.src = icon.icon}} 
                            onMouseOut={(e) => {e.currentTarget.src = icon.iconFaded}} 
                            src={icon.iconClicked?icon.icon : icon.iconFaded} alt=""
                        />
                    </div>
                )
            })
        }
    </div>
}


export default SkillsList;
